//Get Funds from users
//Withdraw funds
//Set a minimum funding value in USD

//SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe{

    uint256 public minimumUsd = 50 * 1e18;

    address[] public funders;
    mapping(address => uint256) public addressToAmountFunded;

    function fund() public payable {
      //want a min amaount fund in USD
      // send eth to this contract
      // payable keyword - contract address 

      require(msg.value >= minimumUsd, "Didn't send enough"); // wei in 1 eth = 10^18
      //revert - > sends gas back to address if condition doesn't pass and prior work is undone
      // 18 decimal places
      funders.push(msg.sender);
      addressToAmountFunded[msg.sender] = msg.value;
    }

    function getPrice() public view returns(uint256){
        //ABI 
        //Address 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        (, int price,,,) = priceFeed.latestRoundData();
        // Eth in USD with 8 decimals
        return uint256(price * 1e10); //typecasting
    }

    function getVersion() public view returns (uint256){
        AggregatorV3Interface priceFeed = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        return priceFeed.version();
    }

    function getConversrionRate(uint256 ethAmount) public view returns(uint256){
 
        uint256 ethPrice = getPrice();
        uint ethAmountInUSD = (ethPrice * ethAmount) / 1e18;
        return ethAmountInUSD;

    }

   // function withdraw(){}
}

